      "objet": "de contribuer à l'animation et au développement du quartier de bergette et des quartiers environnements, dans un cadre convivial, intergénérationnel et multiculturel, sans discrimination aucune ; les objectifs : améliorer le cadre de vie des habitants et favoriser leur bien-être intellectuel, physique, moral et social, en dehors de toutes préoccupations religieuse, philosophique ou politique, sans distinction d'âge, d'ethnie, de situation sociale ou familiale ; organiser et développer un certain nombre d'activités et de services à caractère social (insertion professionnelle) , familial, culturel, éducatif et récréatif (dont accueils de loisirs périscolaires et extrascolaires) , selon les besoins des habitants ; créer du lien, favoriser les échanges et renforcer la solidarité entre les habitants ; donner à chacun la possibilité de s'exprimer tout en participation à l'animation, à la gestion et au développement d'une vie communautaire ; intégrer dans ses actions une démarche de sensibilisation à la santé, à l'environnement et au développement durable ainsi qu'à la culture et aux traditions locales ;",
