      "titre_court": "ASSOCIATION DES BERGERS DU CENTRE A...",
      "objet": "fédérer les éleveurs apporteurs de lait de brebis auprès d'acheteurs de lait de brebis collectant le lait sur l'Aveyron et les départements limitrophes, négocier les conditions générales de vente concernant le lait produit par lesdits adhérents, transmettre aux adhérents  à la suite de chaque négociation les éléments quantitatifs et qualitatifs qui entrent dans les modalités de détermination du prix nouvellement négocié, grille de qualité, de saisonnalité, nouveaux volumes; organiser la mise en place des instruments permettant de connaître le cheptel des adhérents et leur production laitière moyenne et d'établir une organisation de la production laitière de ses adhérents mise à jour à une fréquence appropriée; organiser la mise en place d'un dispositif de traitement des informations provenant de ses adhérents et des entreprises acheteuses de la production afin de déterminer la totalité des volumes à collecter ainsi que leur suivi qualitatif au regard des différents critères rentrant dans les modalités de paiement du lait en fonction de sa composition et de sa qualité; organiser la mise en place d'un dispositif destiné à assurer à ses adhérents, suivant une fréquence appropriée, un retour d'information sur le suivi de la qualité des produits livrés ainsi que sur la saisonnalité de la production, sur les débouchés des produits et les prix obtenus ainsi que sur le suivi de l'application des contrats passés avec les acheteurs, renégocier le cas échéant les clauses des conditions générales de vente notamment la clause relative aux modalités de détermination du prix du lait lorsque celles-ci ne sont plus pertinentes pour l'un des cocontractants, informer ses adhérents des coûts des services rendus dans le cadre de son activité; gérer, informer et communiquer à ses adhérents l'ensemble des données technico-économiques relatives à son objet social; assurer la défense des intérêts des producteurs de lait de brebis, promouvoir les produits issus de la transformation du lait des membres, assurer la représentation de ses membres auprès des pouvoirs publics, des interprofessions, des organismes syndicaux et de toutes les instances, ester en justice, effectuer des formations pour répondre aux besoins et toute opération mobilière, immobilière et financière nécessaire à son objet",
