      "titre_court": "ASSOCIATION DE BIOPHYSIQUE COMPUTATION",
      "objet": "constituer une structure de recherche fondamentale indépendante permettant la mise en oeuvre d'investigations théoriques et computationnelles de systèmes biologiques par des approches biophysiques, biomathématiques ou de chimie quantique ; les thèmes de recherche seront abordés en fonction des moyens (financements, subventions, donations, collaborations) ; l'orientation des sujets de recherche devra toujours être à visée fondamentale, à savoir susceptible de conduire à de nouvelles connaissances scientifiques concernant la structure ou le fonctionnement des systèmes moléculaires ou supramoléculaires étudiés ; les thématiques abordées seront essentiellement à visée biomédicale, incluant : l'étude de mécanismes et la détermination de propriétés au niveau moléculaire ou de systèmes moléculaires (mécanismes réactionnels, interactions, relation structure-activité, mécanistique des canaux ioniques, apoptosome\n) , l'étude du mode d'action d'agents pathogènes (virus, agents cancérigènes\n) , l'étude de molécules à potentiel thérapeutique, les propriétés de systèmes biologiques auto-organisés (dynamique des biomembranes, repliement des protéines\n) , dans le but d'augmenter les connaissances sur le cancer, les maladies neurodégénératives, les maladies infectieuses ou autres pathologies, et dans l'espoir qu'elles soient utiles à la santé ; la compréhension théorique sera épaulée par des outils numériques, tels que ceux de la bioinformatique, de la modélisation moléculaire, de la chimie computationnelle ou de l'apprentissage automatique ; pour ce faire, les outils informatiques qu'elle devra se constituer (logiciels, matériels) seront essentiels pour son fonctionnement ; l'association promouvra également la diffusion de la culture et des connaissances scientifiques par tous les moyens appropriés (conférences, colloques, publications, formation, etc ; ) ; le point sur les travaux réalisés et les diverses informations seront diffusés sur le site internet de l'association ; dans tous les cas, l'association ne poursuit aucun but politique ou religieux ; au vu de son objet, abc\u0026t peut être considérée comme une association d'intérêt général",
